import React from 'react';

class AddFishForm extends React.Component {
    render() {
        return (
            <form>
                <ipput name="name" type="text" placeholder="Name"></ipput>
                <ipput name="name" type="text" placeholder="Price"></ipput>
                <ipput name="name" type="text" placeholder="Status"></ipput>
                <ipput name="desc" type="text" placeholder="Desc"></ipput>
                <ipput name="image" type="text" placeholder="Image"></ipput>
            </form >
        )
    }
}

export default AddFishForm;
